import logo from './logo.svg';
import './App.css';
//Importar componentes 
import CompShowLibros from './Libro/ShowLibros';



function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />

      </header>
      <CompShowLibros></CompShowLibros>
    </div>
  );
}

export default App;
